import { useState } from "react";
import NavBar from "./navbar"
import PipeStatusBox from "../components/pipeStatusBox"
import PopUpSetTime from "../components/popUpSetTime"


function MainPage() {
    const [id,setID] = useState();
    return (
        <div>
            <NavBar />
            <div className="max-w-screen-sm mx-auto flex flex-col gap-2 p-4">
                <PipeStatusBox name="ก็อก 1" number="1" set={setID}/>
                <PipeStatusBox name="ก็อก 2" number="2" set={setID}/>
                <PipeStatusBox name="ก็อก 3" number="3" set={setID}/>
                <PipeStatusBox name="ก็อก 4" number="4" set={setID}/>
            </div>
            <PopUpSetTime id={id}/>
        </div>
        
        
        );
}

export default MainPage;
